import React, { useState, useEffect } from 'react';
import { Box, Tabs, Tab, Typography, Container } from '@mui/material';
import { OptionChainGrid } from './OptionChain/OptionChainGrid';
import { TradeSummary } from './Trade/TradeSummary';
import { VolatilityAnalysis } from './Analysis/VolatilityAnlaysis';
import { StrategyBuilder } from './Strategy/StrategyBuilder';
import { Settings } from './Settings/Settings';
import { useSelector } from 'react-redux';
import type { RootState } from '../store';

interface TabPanelProps {
  children?: React.ReactNode;
  index: number;
  value: number;
}

function TabPanel(props: TabPanelProps) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`tabpanel-${index}`}
      aria-labelledby={`tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box>
          {children}
        </Box>
      )}
    </div>
  );
}

const MainContent: React.FC = () => {
  const [value, setValue] = useState(0);
  const isAuthenticated = useSelector((state: RootState) => state.auth.isAuthenticated);

  const handleChange = (event: React.SyntheticEvent, newValue: number) => {
    setValue(newValue);
  };

  // If not authenticated, automatically show settings tab
  useEffect(() => {
    if (!isAuthenticated) {
      setValue(4); // Settings tab index
    }
  }, [isAuthenticated]);

  return (
    <Box sx={{ width: '100%' }}>
      <Box sx={{ borderBottom: 1, borderColor: 'divider', bgcolor: 'background.paper' }}>
        <Tabs
          value={value}
          onChange={handleChange}
          aria-label="trading tabs"
          variant="scrollable"
          scrollButtons="auto"
          sx={{
            '& .MuiTab-root': {
              fontWeight: 'bold',
              fontSize: '0.9rem',
              minWidth: 120,
            }
          }}
        >
          <Tab label="Option Chain" disabled={!isAuthenticated} />
          <Tab label="Trade Summary" disabled={!isAuthenticated} />
          <Tab label="Volatility Analysis" disabled={!isAuthenticated} />
          <Tab label="Strategy Builder" disabled={!isAuthenticated} />
          <Tab label="Settings" />
        </Tabs>
      </Box>

      <TabPanel value={value} index={0}>
        <Container maxWidth="xl">
          {isAuthenticated ? (
            <OptionChainGrid symbol="NIFTY" />
          ) : (
            <Box sx={{ textAlign: 'center', p: 4 }}>
              <Typography variant="h6" color="text.secondary">
                Please configure your access token in Settings to view Option Chain
              </Typography>
            </Box>
          )}
        </Container>
      </TabPanel>
      <TabPanel value={value} index={1}>
        <Container maxWidth="xl">
          {isAuthenticated ? (
            <TradeSummary />
          ) : (
            <Box sx={{ textAlign: 'center', p: 4 }}>
              <Typography variant="h6" color="text.secondary">
                Please configure your access token in Settings to view Trade Summary
              </Typography>
            </Box>
          )}
        </Container>
      </TabPanel>
      <TabPanel value={value} index={2}>
        <Container maxWidth="xl">
          {isAuthenticated ? (
            <VolatilityAnalysis />
          ) : (
            <Box sx={{ textAlign: 'center', p: 4 }}>
              <Typography variant="h6" color="text.secondary">
                Please configure your access token in Settings to view Volatility Analysis
              </Typography>
            </Box>
          )}
        </Container>
      </TabPanel>
      <TabPanel value={value} index={3}>
        <Container maxWidth="xl">
          {isAuthenticated ? (
            <StrategyBuilder />
          ) : (
            <Box sx={{ textAlign: 'center', p: 4 }}>
              <Typography variant="h6" color="text.secondary">
                Please configure your access token in Settings to use Strategy Builder
              </Typography>
            </Box>
          )}
        </Container>
      </TabPanel>
      <TabPanel value={value} index={4}>
        <Settings />
      </TabPanel>
    </Box>
  );
};

export default MainContent;
